import React from "react";
import { useParams } from "react-router-dom";
import NavBar from "../../components/NavBar/NavBar";

export default function PlacePage() {
  const { id } = useParams();
  return (
    <>
      <NavBar />
      <div>PlacePage - {id}</div>
    </>
  );
}
